import React from 'react';
import {Link} from 'react-router-dom';


const Header = () => {
  return( 
  <header className="py-6 mb-12 border-b">
  <div className="container mx-auto flex justify-between items-center">
  {/* logo */}
  <h1 className='text-dark font-serif font-semibold text-xl md:text-2xl mx-8'>Estatery</h1>
    {/* buttons */}
    <div className="flex items-center gap-6">
      <Link className='text-primary border   px-4 py-3 rounded-lg transition' 
      to=''>Log in</Link>
      <Link className='bg-primary hover:bg-violet-800 text-white px-4 py-3 rounded-lg transition' to=''>Sign up</Link>
    </div>
    </div>
    </header>
  );
};

export default Header;
